import { useContext, useEffect } from "react";
import { AuthContext } from "../../context";

export default function Homepage() {

  const { userGoogle, setUserGoogle } = useContext(AuthContext);
  console.log(userGoogle);
  
  useEffect(() => {
    const storedUserGoogle = localStorage.getItem("userGoogle");
    if (storedUserGoogle) {
      const parsedUserGoogle = JSON.parse(storedUserGoogle);
      setUserGoogle(parsedUserGoogle);
    }
  }, [setUserGoogle]);

  return (
    <div className="container">
      <div className="row">
        <h1> Homepage </h1>
      </div>
      {Object.keys(userGoogle).length !== 0 && (
        <>
          <div className="row">
            <div className="col-6 text-end">
              <h2>Bienvenue {userGoogle.name}</h2>
            </div>
            <div className="col-6 text-center">
              <img src={`${userGoogle.picture}`}></img>
            </div>
          </div>
          <div className="row">
            <p>Vous êtes connecté avec votre Compte Google</p>
          </div>
        </>
      )}
    </div>
  );
}
